import React from 'react';
import { NavLink } from 'react-router-dom';
const Naviger = () => {
    return (
        <div>
            <li>
                <NavLink to='/'>Accueil</NavLink> <br /> </li>
            <NavLink to='/create'>Create</NavLink><br />
            <NavLink to='/update'>Update</NavLink><br />
            <NavLink to='/delete'>Delete</NavLink>


        </div>
    );
};

export default Naviger;
